INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2020/07/31 12:00:00", "アヤネ", 10046, 24001, "2030/12/17 14:59:59", 401, 2, 0.0, 102301, 0.0, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2020/07/31 12:00:00", "アヤネ", 10046, 24002, "2030/12/17 14:59:59", 402, 1, 0.0, 102301, 2.21, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2020/07/31 12:00:00", "アヤネ", 10046, 24003, "2030/12/17 14:59:59", 403, 2, 0.0, 102301, 0.0, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2020/07/31 12:00:00", "アサヒ", 10046, 24004, "2030/12/17 14:59:59", 701, 2, 0.0, 192201, 1.99, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2020/07/31 12:00:00", "アサヒ", 10046, 24005, "2030/12/17 14:59:59", 702, 1, 0.0, 192201, 2.21, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2020/07/31 12:00:00", "アサヒ", 10046, 24006, "2030/12/17 14:59:59", 703, 2, 0.0, 192201, 3.33, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2020/07/31 12:00:00", "部員３", 10046, 24007, "2030/12/17 14:59:59", 801, 2, 0.0, 192301, 0.0, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2020/07/31 12:00:00", "部員３", 10046, 24008, "2030/12/17 14:59:59", 802, 1, 0.0, 192301, 2.68, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2020/07/31 12:00:00", "部員３", 10046, 24009, "2030/12/17 14:59:59", 803, 2, 0.0, 192301, 0.0, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "やった！", "2020/07/31 12:00:00", "", 10046, 24010, "2030/12/17 14:59:59", 501, 1, 0.0, 192501, 0.0, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "勝ったよ！", "2020/07/31 12:00:00", "", 10046, 24011, "2030/12/17 14:59:59", 502, 1, 0.0, 192501, 0.0, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "いい調子！", "2020/07/31 12:00:00", "", 10046, 24012, "2030/12/17 14:59:59", 503, 1, 0.0, 192501, 0.0, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2020/07/31 12:00:00", "ミサト", 10046, 24013, "2030/12/17 14:59:59", 111, 6, 0.0, 113501, 5.33, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2020/07/31 12:00:00", "ミサト", 10046, 24014, "2030/12/17 14:59:59", 112, 1, 0.0, 113501, 6.85, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2020/07/31 12:00:00", "ミサト", 10046, 24015, "2030/12/17 14:59:59", 113, 1, 0.0, 113501, 3.0, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2020/07/31 12:00:00", "ダイチ", 10046, 24016, "2030/12/17 14:59:59", 611, 1, 0.0, 192401, 6.11, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2020/07/31 12:00:00", "ダイチ", 10046, 24017, "2030/12/17 14:59:59", 612, 1, 0.0, 192401, 6.75, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2020/07/31 12:00:00", "ダイチ", 10046, 24018, "2030/12/17 14:59:59", 613, 2, 0.0, 192401, 0.0, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2020/07/31 12:00:00", "ハツネ", 10046, 24019, "2030/12/17 14:59:59", 211, 2, 0.0, 113401, 4.52, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2020/07/31 12:00:00", "ハツネ", 10046, 24020, "2030/12/17 14:59:59", 212, 2, 0.0, 113401, 3.89, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2020/07/31 12:00:00", "ハツネ", 10046, 24021, "2030/12/17 14:59:59", 213, 1, 0.0, 113401, 13.49, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2020/07/31 12:00:00", "カヤ", 10046, 24022, "2030/12/17 14:59:59", 311, 1, 0.0, 106501, 3.17, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2020/07/31 12:00:00", "カヤ", 10046, 24023, "2030/12/17 14:59:59", 312, 1, 0.0, 106501, 4.42, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2020/07/31 12:00:00", "カヤ", 10046, 24024, "2030/12/17 14:59:59", 313, 6, 0.0, 106501, 2.89, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2020/07/31 12:00:00", "アヤネ", 10046, 24025, "2030/12/17 14:59:59", 421, 4, 0.0, 102301, 3.71, 24, 3);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2020/07/31 12:00:00", "アサヒ", 10046, 24026, "2030/12/17 14:59:59", 721, 2, 0.0, 192201, 5.1, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2020/07/31 12:00:00", "部員３", 10046, 24027, "2030/12/17 14:59:59", 821, 1, 0.0, 192301, 4.34, 24, 3);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "いい勝負だったよ\nまたやろうね", "2020/07/31 12:00:00", "", 10046, 24028, "2030/12/17 14:59:59", 521, 1, 0.0, 192501, 0.0, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2020/07/31 12:00:00", "ミサト", 10046, 24029, "2030/12/17 14:59:59", 101, 1, 0.0, 113501, 5.62, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2020/07/31 12:00:00", "ミサト", 10046, 24030, "2030/12/17 14:59:59", 102, 1, 0.0, 113501, 9.58, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2020/07/31 12:00:00", "ミサト", 10046, 24031, "2030/12/17 14:59:59", 103, 2, 0.0, 113501, 0.0, 24, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2020/07/31 12:00:00", "ミサト", 10046, 24032, "2030/12/17 14:59:59", 104, 2, 0.0, 113501, 9.13, 24, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2020/07/31 12:00:00", "ミサト", 10046, 24033, "2030/12/17 14:59:59", 105, 1, 0.0, 113501, 8.27, 24, 2);
